import React from 'react';

const Services = () => {
    return (
        <>
        <div className="container-fluid">           
            <div className="row">
                <div className="col-10 m-auto">
                    <div className="row">
                        <div className="my-3"> <h1>Services</h1> </div>
                   
                        <div className="col-md-4 col-10 mx-auto">

                        </div>
                    </div>
                </div>
            </div>
        </div>
        </>
    );

}
export default Services;
